def _create_temp_icon(icon_data, filename):
    """Create temporary icon file from base64 data"""
    try:
        # Decode base64 data
        icon_bytes = base64.b64decode(icon_data)
        
        # Create temp file
        temp_dir = tempfile.gettempdir()
        icon_path = os.path.join(temp_dir, filename)
        
        # Write icon data
        with open(icon_path, 'wb') as f:
            f.write(icon_bytes)
        
        return icon_path
    except Exception as e:
        print(f"Error creating temp icon: {e}")
        return None
